import React, { Component } from 'react';
import CartS from './Cart';

export class Cart extends Component {
  render() {
    return ( 
        <main>
            {this.props.items.map(el => ( 
               <Cart key={el.id} item = {el}/>))}
        </main>
    );
   }
}

export default Cart
